import {
  BaseBtn,
  GoogleSignInBtn,
  InvertedBtn
} from './button.styles.jsx';

// export const BUTTON_TYPE = {
//   base : 'base',
//   google : 'google',
//   inverted : 'inverted'
// }

export const getBtn = (buttonType = base) => (
  {
    base: BaseBtn,
    google: GoogleSignInBtn,
    inverted: InvertedBtn,
  }[buttonType]
)

const Button = ({children, buttonType, ...otherProps}) => {
  const CustomBtn = getBtn(buttonType)
  return (
    <CustomBtn {...otherProps}>
      {children}
    </CustomBtn>
  )
}

export default Button;
